import React, { useEffect, useRef, useState } from 'react';
import './App.css';

function App() {
  const canvasRef = useRef(null);
  const [neonColor, setNeonColor] = useState(getRandomNeonColor());
  const [reviews, setReviews] = useState([]);

  function getRandomNeonColor() {
    const neonColors = [
      '#ff00ff', // Neon Pink
      '#00ff00', // Neon Green
      '#00ffff', // Neon Cyan
      '#ff9900', // Neon Orange
      '#ff0066', // Neon Rose
      '#3300ff'  // Neon Blue
    ];
    return neonColors[Math.floor(Math.random() * neonColors.length)];
  }

  function generateReview() {
    const names = ["John Doe", "Jane Smith", "Alex Johnson", "Sam Lee", "Terry Mendez", "Louisa Sullivan", "Jasmine Barnett", "Bobby Henderson"];
    const reviews = [
      "Amazing coffee at the cozy café! The baristas were passionate about their craft, and the place was perfect to relax and enjoy a cup of joe.",
      "Great quality and value! The T-shirts I bought from this brand are soft, durable, and affordable. They are now my go-to basics for everyday wear.",
      "Love these sunglasses! Stylish and provide excellent sun protection. A perfect accessory for any outfit.",
      "I had a fantastic time at the museum. The interactive exhibits made learning fun, and the staff's passion for sharing information was evident. It's a perfect place for a family outing."
    ];
    return {
      name: names[Math.floor(Math.random() * names.length)],
      text: reviews[Math.floor(Math.random() * reviews.length)],
      rating: Math.floor(Math.random() * 2) + 4,
      x: Math.random() * window.innerWidth,
      y: Math.random() * window.innerHeight
    };
  }

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;

    setReviews(Array(20).fill().map(generateReview));

    function animate() {
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      reviews.forEach(review => {
        ctx.fillStyle = neonColor;
        ctx.font = '12px Arial';
        ctx.fillText(review.name, review.x, review.y);
        ctx.fillText('★'.repeat(review.rating), review.x, review.y + 15);
        ctx.fillText(review.text.slice(0, 30) + '...', review.x, review.y + 30);

        review.x += (Math.random() - 0.5) * 2;
        review.y += (Math.random() - 0.5) * 2;

        if (review.x < 0) review.x = canvas.width;
        if (review.x > canvas.width) review.x = 0;
        if (review.y < 0) review.y = canvas.height;
        if (review.y > canvas.height) review.y = 0;
      });

      requestAnimationFrame(animate);
    }

    animate();

    document.documentElement.style.setProperty('--neon-color', neonColor);

    const interval = setInterval(() => {
      setReviews(prevReviews => {
        const newReviews = [...prevReviews];
        const indexToReplace = Math.floor(Math.random() * newReviews.length);
        newReviews[indexToReplace] = generateReview();
        return newReviews;
      });
    }, 5000);

    return () => clearInterval(interval);
  }, [neonColor]);

  return (
    <div className="App">
      <canvas ref={canvasRef}></canvas>
      <header>
        <div className="logo animate-logo">Repute</div>
        <nav>
          <button data-info="Go to homepage">Home</button>
          <button data-info="Explore our features">Features</button>
          <button data-info="Check out our resources">Resources</button>
          <button data-info="View pricing options">Pricing</button>
          <button data-info="Get in touch with us">Contact</button>
          <button className="get-started" data-info="Start using Repute">Get started</button>
        </nav>
      </header>
      <main>
        <div className="main-content">
          <h1>
            <span className="heading-line">Boost Trust with</span>
            <span className="heading-line">AI-Crafted Testimonials</span>
          </h1>
          <p>Generate authentic, AI-crafted testimonials in seconds to boost trust, drive conversions, and elevate your brand's reputation.</p>
          <div className="cta-buttons">
            <button className="get-started" data-info="Start using Repute">Get started</button>
            <button className="features" data-info="Explore our features">Features</button>
          </div>
        </div>
      </main>
      <div id="info-box" className="info-box"></div>
    </div>
  );
}

export default App;
